import React, { useState } from "react";
import Button from "@mui/material/Button";
import MenuIcon from "@mui/icons-material/Menu";
import { useNavigate } from "react-router";

import { Drawer, Box } from "@mui/material";
import AddCircleIcon from "@mui/icons-material/AddCircle";

import List from "@mui/material/List";
import Divider from "@mui/material/Divider";
import ListItem from "@mui/material/ListItem";
import ListItemButton from "@mui/material/ListItemButton";
import ListItemIcon from "@mui/material/ListItemIcon";
import ListItemText from "@mui/material/ListItemText";
import InboxIcon from "@mui/icons-material/MoveToInbox";
import MailIcon from "@mui/icons-material/Mail";

import Dialog from "@mui/material/Dialog";
import Rating from "@mui/material/Rating";

import { useForm, Controller } from "react-hook-form";
import Axios from "axios";

function Navbar() {
  const navigate = useNavigate();
  const [isDrawerOpen, setIsDrawerOpen] = useState(false);
  const [dialoglOpen, setDialogOpen] = React.useState(false);
  const [loginOpen, setLoginOpen] = React.useState(false);
  const [value, setValue] = React.useState(0);

  const handleOpen = () => setDialogOpen(true);
  const handleClose = () => setDialogOpen(false);
  const handleOpenLogin = () => setLoginOpen(true);
  const handleCloseLogin = () => setLoginOpen(false);

  const test = [
    {
      route: "Home",
      routeName: "/",
    },
    {
      route: "About Us",
      routeName: "/about",
    },
    {
      route: "Reviews",
      routeName: "/review",
    },
    {
      route: "Comparison",
      routeName: "/comparison",
    },
    {
      route: "Blogs",
      routeName: "/blog",
    },
    {
      route: "Privacy Policy",
      routeName: "/privacy",
    },
    {
      route: "Contact Us",
      routeName: "/contact",
    },
    {
      route: "Terms & Conditions",
      routeName: "/term",
    },
  ];

  const list = (anchor) => (
    <Box>
      <List>
        {test.map((text, index) => (
          <ListItem
            key={text}
            disablePadding
            onClick={() => {
              navigate(text.routeName);
            }}
          >
            <ListItemButton>
              <ListItemIcon>
                {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
              </ListItemIcon>
              <ListItemText primary={text.route} />
            </ListItemButton>
          </ListItem>
        ))}
      </List>
      <Divider />

      <Box style={{ marginTop: "10px", width: "230px" }}>
        <Button
          style={{
            fontSize: "17px",
            color: "white",
            backgroundColor: "#0BB980",
          }}
          onClick={handleOpen}
        >
          Add Reviews <AddCircleIcon />
        </Button>
      </Box>

      <Box style={{ marginTop: "10px", width: "230px" }}>
        <Button
          style={{
            fontSize: "10px",
            color: "white",
            backgroundColor: "red",
          }}
          onClick={handleOpenLogin}
        >
          Admin Login
        </Button>
      </Box>
    </Box>
  );

  const { handleSubmit, control } = useForm();

  const onSubmit = (data) => {
    const finalData = { ...data, Rating: value };
    console.log(finalData);
    Axios.post("http://localhost:3001/reviews", finalData)
      .then((response) => {
        console.log(response);
      })
      .catch((error) => {
        console.log(error);
      });
  };

  return (
    <div className="home-top-bar">
      <button
        className="home-top-bar-section logo-section"
        style={{ background: "none", border: "none" }}
        onClick={() => {
          navigate("/");
        }}
      >
        courseClipper
      </button>

      <div className="home-top-bar-section button-section">
        <input
          type="text"
          id="navbar-search-box"
          style={{ paddingLeft: "17px" }}
          placeholder="Search Course..."
        />
        <Button
          id="navbar-rev"
          variant="outlined"
          onClick={() => {
            navigate("/review");
          }}
        >
          REVIEW
        </Button>

        <Button
          onClick={() => {
            setIsDrawerOpen(true);
          }}
        >
          <MenuIcon style={{ color: "#707070", fontSize: "3.5rem" }} />
        </Button>
      </div>

      {/* drawer */}
      <Drawer
        anchor="left"
        open={isDrawerOpen}
        onClose={() => setIsDrawerOpen(false)}
      >
        <Box p={2} width="265px" textAlign="center" role="presentation">
          {list()}
        </Box>
      </Drawer>

      {/*add reviews Dialog box */}
      <Dialog
        open={dialoglOpen}
        onClose={handleClose}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"
      >
        <Box className="dialog-box">
          <div className="main-div-dialog">
            <Box className="dialog-sub-box" style={{ lineHeight: "0" }}>
              <h4>Rate Your Recent Experience</h4>
              <Rating
                name="simple-controlled"
                value={value}
                onChange={(event, newValue) => {
                  setValue(newValue);
                  console.log(newValue);
                }}
              />
              <h4>Tell Us More About Your Exerience</h4>
            </Box>

            <form onSubmit={handleSubmit(onSubmit)}>
              <Box className="dialog-sub-box" style={{ lineHeight: "0" }}>
                <h4>
                  <a href="/privacy">Read Our Guidelines for Reviewers</a>
                </h4>
                <Controller
                  name="courseDescription"
                  control={control}
                  defaultValue=""
                  render={({ field }) => (
                    <textarea
                      {...field}
                      id="course-description"
                      rows="4"
                      style={{
                        width: "325px",
                        borderRadius: "5px",
                        border: "1px solid grey",
                      }}
                    />
                  )}
                />
                <h4>
                  <a href="/review">How to write a useful review</a>
                </h4>
              </Box>

              <div className="dialog-sub-box">
                <div style={{ display: "flex", flexDirection: "column" }}>
                  <label htmlFor="course-name">Enter Your Name</label>
                  <Controller
                    name="username"
                    control={control}
                    defaultValue=""
                    render={({ field }) => (
                      <input
                        {...field}
                        type="text"
                        id="course-name"
                        style={{
                          width: "325px",
                          height: "35px",
                          borderRadius: "5px",
                          border: "1px solid grey",
                        }}
                      />
                    )}
                  />
                </div>

                <div style={{ display: "flex", flexDirection: "column" }}>
                  <label htmlFor="course-name">Enter Your Email Id</label>
                  <Controller
                    name="emailId"
                    control={control}
                    defaultValue=""
                    render={({ field }) => (
                      <input
                        {...field}
                        type="email"
                        id="course-name"
                        style={{
                          width: "325px",
                          height: "35px",
                          borderRadius: "5px",
                          border: "1px solid grey",
                        }}
                      />
                    )}
                  />
                </div>

                <div style={{ display: "flex", flexDirection: "column" }}>
                  <label htmlFor="course-name">Enter Your Course Name</label>
                  <Controller
                    name="courseName"
                    control={control}
                    defaultValue=""
                    render={({ field }) => (
                      <input
                        {...field}
                        type="text"
                        id="course-name"
                        style={{
                          width: "325px",
                          height: "35px",
                          borderRadius: "5px",
                          border: "1px solid grey",
                        }}
                      />
                    )}
                  />
                </div>

                <div style={{ display: "flex", flexDirection: "column" }}>
                  <label htmlFor="platform-name">Give your platform name</label>
                  <Controller
                    name="platformName"
                    control={control}
                    defaultValue=""
                    render={({ field }) => (
                      <input
                        {...field}
                        type="text"
                        id="platform-name"
                        style={{
                          width: "325px",
                          height: "35px",
                          borderRadius: "5px",
                          border: "1px solid grey",
                        }}
                      />
                    )}
                  />
                </div>

                <div style={{ display: "flex", flexDirection: "column" }}>
                  <label htmlFor="course-url">Enter Course URL</label>
                  <Controller
                    name="courseURL"
                    control={control}
                    defaultValue=""
                    render={({ field }) => (
                      <input
                        {...field}
                        type="url"
                        id="course-url"
                        style={{
                          width: "325px",
                          height: "35px",
                          borderRadius: "5px",
                          border: "1px solid grey",
                        }}
                      />
                    )}
                  />
                </div>

                <div style={{ display: "flex", flexDirection: "column" }}>
                  <label htmlFor="purchase-date">Enter purchased date</label>
                  <Controller
                    name="purchaseDate"
                    control={control}
                    defaultValue=""
                    render={({ field }) => (
                      <input
                        {...field}
                        type="date"
                        id="purchase-date"
                        style={{
                          width: "325px",
                          height: "35px",
                          borderRadius: "5px",
                          border: "1px solid grey",
                        }}
                      />
                    )}
                  />
                </div>
              </div>

              {/* <button type="submit">Submit</button> */}
              <div style={{ margin: "29px 120px 0px" }}>
                <Button
                  onClick={handleClose}
                  variant="contained"
                  type="submit"
                  sx={{ backgroundColor: "rgb(9, 143, 96)", width: "100px" }}
                >
                  Save
                </Button>
              </div>
            </form>
          </div>
        </Box>
      </Dialog>
    

    {/* login form dialog box */}
      <Dialog
        open={loginOpen}
        onClose={handleCloseLogin}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"
      >
        <Box className="login-dialog" style={{width:"400px", height:"300px"}}>
          <div className="main-lgn">
            <div className="login-text">
                    <h2>Login</h2>
            </div>
            <div className="input-1-box">
                <label htmlFor="username">Enter Your Username</label>
                <input type="text" id="username" />
            </div>
            <div className="input-1-box">
                <label htmlFor="username">Enter Your Username</label>
                <input type="text" id="username" />
            </div>
            <div className="lgn-btn">
                <Button type="submit">Login</Button>
            </div>
          </div>
        </Box>
      </Dialog>
    </div>
  );
}

export default Navbar;
